import './App.css';
import './assets/andrei.jpg';

function Home() {
  return (
    <div id="home">
      <div className="App-aboutBG">
        <p className="App-aboutName">About Me</p>

        <content className="App-body">
          <p>HI</p>
          <p>My Name is Andrei Frunza</p>
          <p>I'm in my final year at Ryerson University, completing my bachelors in</p>
        </content>
 
      </div>
      
      
    </div>
  );
}

export default Home;
